import { BrowserRouter as Router, Switch, Routes } from 'react-router-dom';
import './App.css';
import Landing from './components/Landing';

function App() {
  return <Router>
    <>
      <Switch path='/' element={<Landing />} />
    </>
  </Router>
}

export default App;
